import './Header.scss';

const Header = () => {
  return (
    <header>
      <a href="https://github.com/cqxg" rel="noreferrer" target="_blank">
        <span>Settings</span>
      </a>
      <a href="/statistic" rel="noreferrer" target="_blank">
        <span>Statistics</span> />
      </a>
    </header>
  );
};

export default Header;
